import React, { Component } from 'react';
import './inc.css';


class inc extends Component {
  render() {
    return (
      <div className="inc">

        <div class="inc-box">
          hello

          <div class="x-inc" onClick={()=>{ yellow(); }}> <i class="fas fa-times xinc"></i> </div>

        </div>

      </div>
    );
  }
}

export default inc;
